Psalm 107, 24

The God I serve is a mighty God. He is not the nice, tame, Santa Claus type some mistake him for. He is completely good, completely just, literally larger than life. His love is as wild and passionate, as uncompromising as the stormy sea. His works are glorious and fearsome to behold. He deserves all glory and the only gift worthy of the king of the Universe, whom everything already belongs to, is to give the only thing that is mine to give: Myself. To submit my will, my thoughts, my dreams, all that I am, to Him the one who is trustworthy. I trust that he knows best in every single thing.
Jesus says, "If you cling to your life, you will lose it; but if you give up your life for me, you will find it." (Matthew 10,39)
